window.bookSummaryJSON = "<p>From the realms of the Afterlife Saga comes a new spin on this Gothic world....</p> <p>When a bunch of misfit orphans all find themselves on a bus heading towards a new life, one called Afterlife, it wasn’t quite what they had in mind. But even fate can play games and five teens will soon find themselves asking even more questions than ever before.</p> <p>Questions about an uncertain future in this new world and the very first one on the top of that long list...what does the King of Heaven and Hell have in store for them?</p> <p>This is a continuation of the Afterlife Saga, suitable for young adults but a must listen for all Afterlife fans!</p>"; 
